  [],\n\t\"revision_timestamp\": \"2016-07-27T23:04:46.058200\",\n\t\"name\": \"2005-land-cover-and-land-use-spatial-database-of-big-stone-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey (USGS) - Upper
  Midwest Environmental Sciences Center (UMESC) has produced a high-resolution land
  cover/land use (LCU) spatial database of Big Stone National Wildlife Refuge (BSNWR).
  The LCU data were interpreted from September 20, 2005 color-infrared (CIR) aerial
  photographs (1:10,000-scale). Vegetation types were classified with refuge-derived
  classes and then linked to the National Vegetation Classification System (NVCS)
  at the Formation level, and whenever possible, the Alliance level. The photos were
  interpreted using a minimum mapping unit of 1-acre and a 10% minimum vegetation
  cover. The photos were interpreted to delineate land cover/land use, percent vegetation
  cover, and tree height. The geographic extent of the BSNWR LCU database encompasses
  19,192 acres of wetland and upland habitat in Big Stone and Lac Qui Parle Counties,
  Minnesota.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
